import {fromEvent, debounceTime, of} from "rxjs";
import {distinctUntilChanged} from "rxjs/src/internal/operators/distinctUntilChanged";

console.log('rxjs')

of(1,1,2,3,4,5,6,6,7,8,8)
        .pipe(
                distinctUntilChanged()
        )
        .subscribe(console.log)


console.log('rxjs')
